import React, { useState } from "react";
import Link from "next/link";
import { FormGroup, FormControlLabel, Checkbox } from "@material-ui/core";
import {
  Container,
  Text,
  SubHeader,
  Input,
  PrimaryButton,
  SubText,
  Header,
  ActionButton,
  CaptionText,
} from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";
import { Dropdown } from "../styledComponents";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  flex: 0.3;
  padding-top: 50px;
  padding-left: 60px;
  padding-right: 10px;

  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
`;
const FormWrapper = styled(Container)`
  flex-direction: column;
  padding-top: 40px;
  padding-left: 60px;
  padding-right: 60px;
  flex: 0.7;
  min-height: 100%;
  max-height: 100%;
`;
const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 50%;
  flex: 0.72;
  padding-top: 30px;
  padding-bottom: 20px;
  /* background-color: red; */
`;

const CompleteRegister = () => {
  const [state, setState] = React.useState({
    checkedA: false,
    checkedB: false,
  });
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [sex, setSex] = useState([]);
  const [options, setOptions] = useState([
    { id: 1, value: "Male" },
    { id: 2, value: "Female" },
  ]);
  const handleChange = (event) => {
    setState({ ...state, [event.target.name]: event.target.checked });
  };

  const handleClickOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };
  // const valuesList = () => {
  //   return (
  //     <div>
  //       {list.map((lst) => (
  //         <span key={lst.id}>{lst.value + ", "}</span>
  //       ))}
  //     </div>
  //   );
  // };
  console.log(sex)
  return (
    <Container
      flex={1}
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <FormWrapper>
        <Container flex={false} row center color="transparent">
          <img
            src={hasLogo}
            style={{ width: "50px", height: "50px", marginRight: "10px" }}
          />
          <Text>House-Assist Space</Text>
        </Container>
        <Container flex={1} column center>
          <Form>
            <Header customStyles={{ fontWeight: "400", marginBottom: 5 }}>
              Provide more information
            </Header>

            <fieldset
              style={{
                display: "flex",
                paddingTop: "30px",
                paddingLeft: 0,
                paddingRight: 0,
                paddingBottom: 0,
                border: "none",
                flexDirection: "column",
                marginBottom: 10,
              }}
            >
              <CaptionText customStyles={{ marginBottom: 10 }}>
                Tell us a little more about yourself
              </CaptionText>
              <Input label="FIRST NAME" placeholder="First Name" type="text" />
              <Input label="LAST NAME" placeholder="Last Name" type="text" />
              <Input
                label="PHONE NUMBER"
                placeholder="Phone Number"
                type="tel"
              />
              <Container row>
                <Dropdown
                  // title={sex.length <= 0 ? sex[0].value : "choose"}
                  anchorEl={anchorEl}
                  handleOpen={handleClickOpen}
                  handleClose={handleClose}
                  selection={sex}
                  setSelection={setSex}
                  items={options}
                  wrapperStyles={{ backgroundColor: "#fff" }}
                />
              </Container>
              <CaptionText
                customStyles={{
                  marginBottom: 10,
                  fontSize: 11,
                  color: "#323130",
                }}
              >
                WHY ARE YOU JOINING HOUSE-ASSIST SPACE
              </CaptionText>
              <FormGroup column>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={state.checkedA}
                      onChange={handleChange}
                      name="checkedA"
                      color="#0078D4"
                    />
                  }
                  label="I own a properties i want to manage"
                />
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={state.checkedB}
                      onChange={handleChange}
                      name="checkedB"
                      color="#0078D4"
                    />
                  }
                  label="I want to test and check your platform"
                />
              </FormGroup>
            </fieldset>

            <PrimaryButton
              type="submit"
              customStyles={{ padding: 12, marginTop: 10 }}
            >
              Create your account
            </PrimaryButton>
          </Form>
        </Container>
      </FormWrapper>
      <ImgWrapper />
    </Container>
  );
};

export default CompleteRegister;
